<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <title>Trivia Guaran√≠</title>
    <style>
        .logo {
            position: fixed;
            left: 20px;
            top: 20px;
            width: 200px;
            height: auto;
            z-index: 1000;
        }

        body {
            font-family: 'Arial', sans-serif;
            background: linear-gradient(135deg, #1e3c72, #2a5298);
            color: white;
            display: flex;
            flex-direction: column;
            align-items: center;
            min-height: 100vh;
            margin: 0;
            padding: 20px;
        }

        .container {
            text-align: center;
            max-width: 800px;
            width: 100%;
        }

        .wheel-container {
            position: relative;
            width: 300px;
            height: 300px;
            margin: 20px auto;
        }

        .wheel {
            width: 100%;
            height: 100%;
            border-radius: 50%;
            position: relative;
            transition: transform 3s ease-out;
            background: conic-gradient(
                #ffd600 0% 50%,
                #ffeb3b 50% 100%
            );
            box-shadow: 0 0 20px rgba(0,0,0,0.3);
            border: 8px solid rgba(255, 255, 255, 0.2);
        }

        .wheel::before {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 280px;
            height: 280px;
            border-radius: 50%;
            background: conic-gradient(
                #ffd600 0% 50%,
                #ffeb3b 50% 100%
            );
            z-index: 1;
        }

        .wheel::after {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 260px;
            height: 260px;
            border-radius: 50%;
            background: linear-gradient(135deg, #ffd600, #ffeb3b);
            z-index: 2;
        }

        .wheel-text {
            position: absolute;
            width: 100%;
            text-align: center;
            font-size: 18px;
            font-weight: bold;
            color: #1e3c72;
            text-shadow: 1px 1px 2px rgba(255,255,255,0.5);
            z-index: 3;
        }

        .wheel-text.spanish {
            top: 30%;
            transform: rotate(-90deg);
        }

        .wheel-text.english {
            bottom: 30%;
            transform: rotate(90deg);
        }

        .wheel-pointer {
            position: absolute;
            top: -20px;
            left: 50%;
            transform: translateX(-50%);
            width: 0;
            height: 0;
            border-left: 20px solid transparent;
            border-right: 20px solid transparent;
            border-top: 40px solid #81c784;
            z-index: 4;
            filter: drop-shadow(0 0 5px rgba(0,0,0,0.3));
            pointer-events: none;
        }

        .wheel-pointer::after {
            content: '';
            position: absolute;
            top: -40px;
            left: -10px;
            width: 20px;
            height: 20px;
            background: #81c784;
            border-radius: 50%;
        }

        .button {
            background: rgba(255, 255, 255, 0.1);
            border: 2px solid white;
            color: white;
            padding: 10px 20px;
            margin: 10px;
            border-radius: 25px;
            cursor: pointer;
            transition: all 0.3s;
            width: 80%;
            max-width: 300px;
        }

        .button:hover {
            background: rgba(255, 255, 255, 0.2);
            transform: scale(1.05);
        }

        .button.correct {
            background: #4CAF50;
            border-color: #4CAF50;
            color: white;
        }

        .button.incorrect {
            background: #f44336;
            border-color: #f44336;
            color: white;
        }

        .question-container {
            background: rgba(255, 255, 255, 0.1);
            padding: 20px;
            border-radius: 15px;
            margin: 20px 0;
            display: none;
            backdrop-filter: blur(5px);
        }

        .score {
            font-size: 24px;
            margin: 20px 0;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
        }

        .timer-bar {
            width: 100%;
            height: 10px;
            background: rgba(255, 255, 255, 0.2);
            border-radius: 5px;
            margin: 10px 0;
            overflow: hidden;
        }

        .timer-progress {
            width: 100%;
            height: 100%;
            background: #4ECDC4;
            transition: width 1s linear;
        }

        .result-message {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            background: rgba(0, 0, 0, 0.9);
            padding: 20px;
            border-radius: 10px;
            display: none;
            z-index: 1000;
            backdrop-filter: blur(5px);
            text-align: center;
            min-width: 300px;
        }

        .result-message p {
            margin-bottom: 15px;
        }

        .continue-button {
            background: #4ECDC4;
            border: none;
            color: white;
            padding: 10px 20px;
            border-radius: 5px;
            margin: 0 auto;
            cursor: pointer;
            transition: all 0.3s;
            display: block;
            width: fit-content;
        }

        .continue-button:hover {
            background: #45b7af;
        }

        @keyframes shake {
            0%, 100% { transform: translateX(0); }
            25% { transform: translateX(-10px); }
            75% { transform: translateX(10px); }
        }

        .shake {
            animation: shake 0.5s ease-in-out;
        }

        .time-display {
            font-size: 24px;
            margin: 10px 0;
            color: #FFE66D;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
        }

        .feedback-message {
            position: fixed;
            top: 20px;
            left: 50%;
            transform: translateX(-50%);
            padding: 15px 30px;
            border-radius: 25px;
            font-size: 20px;
            font-weight: bold;
            opacity: 0;
            transition: opacity 0.3s;
            z-index: 1000;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.5);
        }

        .feedback-message.correct {
            background: rgba(76, 175, 80, 0.9);
            color: white;
        }

        .feedback-message.incorrect {
            background: rgba(244, 67, 54, 0.9);
            color: white;
        }

        .feedback-message.time {
            background: rgba(255, 230, 109, 0.9);
            color: #1e3c72;
        }

        @keyframes fadeInOut {
            0% { opacity: 0; transform: translateX(-50%) translateY(-20px); }
            20% { opacity: 1; transform: translateX(-50%) translateY(0); }
            80% { opacity: 1; transform: translateX(-50%) translateY(0); }
            100% { opacity: 0; transform: translateX(-50%) translateY(-20px); }
        }

        .show-feedback {
            animation: fadeInOut 2s ease-in-out forwards;
        }
    </style>
</head>
